import { Buffer } from 'buffer';
import * as oasis from 'oasis-std';
export class Leak {
    public static BYTECODE =
        '';
    private constructor(
        readonly address: oasis.Address,
        private gateway: oasis.Gateway,
    ) {}
    public static async connect(
        address: oasis.Address,
        gateway: oasis.Gateway,
    ): Promise<Leak> {
        return new Leak(address, gateway);
    }
    public static async deploy(
        gateway: oasis.Gateway,
        {
            publicDescription,
            message,
            messageReleaseTime,
        }: {
            publicDescription: string;
            message: string;
            messageReleaseTime: BigInt;
        },
        options?: oasis.DeployOptions,
    ): Promise<Leak> {
        const payload = Leak.makeDeployPayload(
            publicDescription,
            message,
            messageReleaseTime,
        );
        try {
            const deployedAddr = await gateway.deploy(payload, options);
            return new Leak(deployedAddr, gateway);
        } catch (e) {
            throw e;
        }
    }
    private static makeDeployPayload(
        publicDescription: string,
        message: string,
        messageReleaseTime: BigInt,
    ): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8Array(Buffer.from(Leak.BYTECODE, 'base64'));
        return oasis.abiEncode(
            [
                'string' as oasis.Schema,
                'string' as oasis.Schema,
                'u64' as oasis.Schema,
            ],
            [publicDescription, message, messageReleaseTime],
            encoder,
        );
    }
    public async changeReleaseTime(
        { newTime }: { newTime: BigInt },
        options?: oasis.RpcOptions,
    ): Promise<void> {
        const payload = Leak.makeChangeReleaseTimePayload(newTime);
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return;
        } catch (e) {
            if (e instanceof oasis.RpcError.Execution) {
                throw oasis.abiDecode('string' as oasis.Schema, e[0]);
            }
            throw e;
        }
    }
    private static makeChangeReleaseTimePayload(newTime: BigInt): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(0);
        return oasis.abiEncode(['u64' as oasis.Schema], [newTime], encoder);
    }
    public async message(options?: oasis.RpcOptions): Promise<string> {
        const payload = Leak.makeMessagePayload();
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode('string' as oasis.Schema, res);
        } catch (e) {
            if (e instanceof oasis.RpcError.Execution) {
                throw oasis.abiDecode('string' as oasis.Schema, e[0]);
            }
            throw e;
        }
    }
    private static makeMessagePayload(): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(1);
        return encoder.finish();
    }
    public async getPublicDescription(
        options?: oasis.RpcOptions,
    ): Promise<string> {
        const payload = Leak.makeGetPublicDescriptionPayload();
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode('string' as oasis.Schema, res);
        } catch (e) {
            if (e instanceof oasis.RpcError.Execution) {
                throw oasis.abiDecode('string' as oasis.Schema, e[0]);
            }
            throw e;
        }
    }
    private static makeGetPublicDescriptionPayload(): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(2);
        return encoder.finish();
    }
}
